import React from 'react';
import { Form, Card, Button } from 'antd';

const UserProfile = () =>{


    return(
        <Card actions={[
            <div key="twit">짹<br/>0</div>,
            <div key="followings">팔로잉<br/>0</div>,
            <div key="followings">팔로워<br/>0</div>
        ]}>
            <Card.Meta avatar="" title="me"/>
            <Button>로그아웃</Button>
        </Card>
    );
}

export default UserProfile;
